body:
@IgorMinar love what you've done with $resource, please take a look at the relationship implementation below.

Remember that once you have the primary key for one level, you usually don't need to include the levels above because you've already got your specific object. In other words, you shouldn't need too many cases where a URL is deeper than 2 levels deep eg `/resource/identifier/resource`. (http://info.apigee.com/Portals/62317/docs/web%20api.pdf)

Example
```javascript
var CreditCard = $resource('/card/:cardId', {cardId:'@id'}, {
  charge: {method:'POST', params:{charge:true}}
});
var User = $resource('/user/:userId', {userId:'@id'}, {}, {CreditCard:CreditCard});
var cards = User.CreditCard.query({userId:123}, function() {
  // GET: /user/123/card
  // server returns: [ {id:456, number:'1234', name:'Smith'} ];

  var card = cards[0];
  // each item is an instance of CreditCard
  expect(card instanceof CreditCard).toEqual(true);
  card.name = "J. Smith";
  // non GET methods are mapped onto the instances
  card.$save();
  // POST: /card/456 {id:456, number:'1234', name:'J. Smith'}
  // server returns: {id:456, number:'1234', name: 'J. Smith'};

  // our custom method is mapped as well.
  card.$charge({amount:9.99});
  // POST: /card/456?amount=9.99&charge=true {id:456, number:'1234', name:'J. Smith'}
});
```

This will allow people to be slightly more elegant:

instead of:
```
var deferred = $q.defer();
deferred.resolve('foobar');
return deferred.promise;
```
we can now do:
```
return $q.defer().resolve('foobar');
```

This also slightly makes `$q.reject()` redundant:
```
return $q.defer().reject('barfoo');
```

BREAKING CHANGE: Concatenating expressions makes it hard to reason about
    whether some combination of concatenated values are unsafe to use
    and could easily lead to XSS.  By requiring that a single expression
    be used for *[src/ng-src] such as iframe[src], object[src], etc.
    (but not img[src/ng-src] since that value is sanitized), we ensure that the value
    that's used is assigned or constructed by some JS code somewhere
    that is more testable or make it obvious that you bound the value to
    some user controlled value.  This helps reduce the load when
    auditing for XSS issues.

    To migrate your code, follow the example below:

        Before:
            JS:
                scope.baseUrl = 'page';
                scope.a = 1;
                scope.b = 2;
            HTML:
                <!-- Are a and b properly escaped here? Is baseUrl
                     controlled by user? -->
                <iframe src="{{baseUrl}}?a={{a}&b={{b}}">

        After:
            JS:
                var baseUrl = "page";
                scope.getIframeSrc = function() {
                  // There are obviously better ways to do this.  The
                  // key point is that one will think about this and do
                  // it the right way.
                  var qs = ["a", "b"].map(function(value, name) {
                      return encodeURIComponent(name) + "=" +
                             encodeURIComponent(value);
                    }).join("&");
                  // baseUrl isn't on scope so it isn't bound to a user
                  // controlled value.
                  return baseUrl + "?" + qs;
                }
            HTML: <iframe src="{{getIframeSrc()}}">
